Is there specific way to do an if-else statement in javascript for mongodb using mongoose?<p>I want to only run a statement only if the object is not null. If it is null I want to not do anything. I want to be sure if there is a proper way to achieve this. For example I tried it on MongoDB Playground and it did not work. Here is the link to playground: <a href="https://mongoplayground.net/p/yOmRxML88zi" rel="nofollow noreferrer">https://mongoplayground.net/p/yOmRxML88zi</a></p>
<p>Here is the if-else statement I want to run:</p>
<pre><code>    db.collection.aggregate([
       {...},
       service_type ? { $match: { serviceType: service_type } } : null,
       {...},
]);
</code></pre>
<p>So if the service_type is not null run the statement else skip to next object in the aggregation. What I want to do in this occasion is get the list of everything in database (objects) that contain certain service type given by the user.</p>
<p>The schema looks something like this:</p>
<pre><code>const sellerSchema = new mongoose.Schema({
  user_id: {
    type: mongoose.Schema.Types.ObjectId,
    ref: &quot;User&quot;,
  },

  ...,

  serviceType: [{ String }],
});
</code></pre>

