Mongoose return documents created before a particular month<p>I am trying to get users who registered before a particular month:</p>
<pre><code>const getUsersWhoRegisteredBeforeAGivenMonth = async (month, year) =&gt; {
  const project_stage = {
    $project: {
      year: { $year: &quot;$date&quot; },
      month: { $month: &quot;$date&quot; },
    },
  };

  const filter_stage = {
    $match: {
      year: {
        $lte: parseInt(year),
      },
      month: {
        $lte: parseInt(month),
      },
    },
  };

  const pipeline = [project_stage, filter_stage];
  const users = await User.aggregate(pipeline);
  return users;
};
</code></pre>
<p>But, this returns the wrong results.<br />
When <code>month = 1</code> and <code>year = 2022</code>, instead of returning all the documents created before <em><strong>01/2022</strong></em>, it returns the documents created from the <strong>beginning of 2022</strong> until the end of <em><strong>01/2022</strong></em> and the documents created from the <strong>beginning of 2021</strong> until the end of <em><strong>01/2021</strong></em>.<br />
And if I pick <em><strong>02/2022</strong></em>, it will do the same thing until the end of <em><strong>02/2022</strong></em> and <em><strong>01/2021</strong></em>.</p>
<p>Any idea how to fix this?</p>

