                    {
                        &quot;areaCode&quot;: &quot;A-1&quot;
                    },
                    {
                        &quot;areaCode&quot;: &quot;A-2&quot;
                    }
                ]
            }
        ]
    },
    {
        &quot;userID&quot;: &quot;2&quot;,
        &quot;areaCodes&quot;: [
            {
                &quot;areaCode&quot;: [
                    {
                        &quot;areaCode&quot;: &quot;A-1&quot;
                    }
                ]
            }
        ]
    }
]
</code></pre>
<p>My desired output would be to remove the excess areaCode objects and group them inside an array for each user like:</p>
<pre><code>[
    {
        &quot;userID&quot;: &quot;1&quot;,
        &quot;areaCodes&quot;: [&quot;A-1&quot;, &quot;A-2&quot;]
    },
    {
        &quot;userID&quot;: &quot;2&quot;,
        &quot;areaCodes&quot;: [&quot;A-1&quot;]
    }
]
</code></pre>
<p>How to achieve this format? Thanks.</p>

