MongoClient doesn't read from secondary server<p>I'm trying to use a cluster of documentDB on AWS.
On this cluster, I have 2 instances, one primary for writeOps and one secondary for readOps...</p>
<p>If I create the connection with connectionString like this:</p>
<pre class="lang-java prettyprint-override"><code>String host = getHost();
Integer port = Integer.parseInt(getPort());
String[] arrCredentials = getCredentials();
String credentials = String.format(&quot;%s:%s&quot;, arrCredentials[0], arrCredentials[1]);
String database = getDatabase();
String options = &quot;ssl=true&amp;replicaSet=rs0&amp;readPreference=secondaryPreferred&quot;;

String connection = String.format(&quot;mongodb://%s@%s:%d/%s?%s&quot;, 
                        credentials, host, port, database, options);
return MongoClients.create(new ConnectionString(connection));
</code></pre>
<p>It works well, and the readOps are served by the secondary instance...</p>
<p>But, when I try to use <code>MongoClients.create()</code> this way:</p>
<pre class="lang-java prettyprint-override"><code>public MongoClient mongoClient() {
    return MongoClients.create(MongoClientSettings.builder()
            .applyToClusterSettings(settings -&gt;
                    settings
                         .hosts(singletonList(new ServerAddress(
                                    getHost(), Integer.parseInt(getPort()))))
                         .requiredReplicaSetName(&quot;rs0&quot;)
                         .requiredClusterType(ClusterType.REPLICA_SET)
            )
            .applyToSslSettings(setting -&gt;
                    setting.enabled(true)
            )
            .readPreference(ReadPreference.secondaryPreferred())
            .credential(getCredential())
            .build());
}
</code></pre>
<p>All calls, readOps and writeOps, are served by the primary instance.</p>

